import React, {useState, useEffect} from 'react';
import {useAuth} from './AuthContext';
import {useNavigate} from 'react-router-dom';
import './App.css';
import LandingNavBar from './LandingNavBar';
import HomeNavBar from './HomeNavBar';

function App() {
	const navigate = useNavigate();
	const {currentUser, isLoggedIn}= useAuth();
	const [currentPage, setCurrentPage] = useState(landingNavBar);

	useEffect(() => {

		const homeNavBar = <HomeNavBar/>;

		const landingNavBar = <LandingNavBar/>;
		if(isLoggedIn && currentUser > 0 && currentPage !== homeNavBar){
			setCurrentPage(homeNavBar);
			navigate("/");
		}
		else if (currentPage !== landingNavBar){
			setCurrentPage(landingNavBar);
		}

	}, [isLoggedIn, currentUser, homeNavBar, landingNavBar, navigate, currentPage]);
	return (
		<div className='App'>
			{currentPage}
		</div>
	);
}

export default App;
